Tables are sinks of data. At the lowest form they are wrappers around concurrent maps that offer some value add in propogating updates and deletes for through the system. Data tables are represented by the interface io.venuu.vuu.core.table.DataTable in the source code. trait DataTable extends KeyedObservable[RowKeyUpdate] with RowSource { def getTableDef: TableDef //<snip/> def processUpdate(rowKey: String, rowUpdate: RowWithData, timeStamp: Long): Unit def processDelete(rowKey: String): Unit def size(): Long = { primaryKeys.length } //<snip/>
} The important methods from this trait for these purposes are: def processUpdate(...)
def processDelete(...) These are the methods that you call in a provider to populate data into the underlying map. If you go back to the Providers example you can see it is indeed the update method being called. processUpdate functions like an upsert in a SQL data (i.e. it is used for both an insert and an update)

